(function(){function a(g,e,d,b){var c=g%10;if((c==1)&&((g==1)||(g>20))){return e}else{if((c>1)&&(c<5)&&((g>20)||(g<10))){return d}else{return b}}}jQuery.timeago.settings.strings={prefixAgo:null,prefixFromNow:"через",suffixAgo:"назад",suffixFromNow:null,seconds:"меньше минуты",minute:"минуту",minutes:function(b){return a(b,"%d минута","%d минуты","%d минут")},hour:"час",hours:function(b){return a(b,"%d час","%d часа","%d часов")},day:"день",days:function(b){return a(b,"%d день","%d дня","%d дней")},month:"месяц",months:function(b){return a(b,"%d месяц","%d месяца","%d месяцев")},year:"год",years:function(b){return a(b,"%d год","%d года","%d лет")}}})();